import './App.css';
import { useState } from 'react';
import { AuthPage } from './auth';

function App() {

  const [user, setUser] = useState(sessionStorage.getItem("user"));

  const logout = () => {
    sessionStorage.setItem("user", "")
    setUser("");
  }

  return (
    <div className="App">
      <h1>User Authentication App</h1>
      <AuthenticationForm />
    </div>
  );
};


export default App;
